import axios from "axios"

const instance=axios.create({
    baseURL:"http://localhost:3001/data"
})

export const UsersApi = (pageSize,currentPage) => {
  return (
    instance
    .get(
      `?_limit=${pageSize}&_page=${currentPage}`,{
        withCredentials:true
      }
    )
  )
}
